import React from 'react';
import { Container, Typography, Box, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

const GlassContainer = styled(Paper)({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.8) 0%, rgba(22, 33, 62, 0.8) 100%)',
  backdropFilter: 'blur(16px)',
  borderRadius: '20px',
  border: '1px solid rgba(255, 255, 255, 0.1)',
  padding: '2rem',
  marginTop: '2rem',
  color: 'white',
  boxShadow: '0 8px 32px 0 rgba(103, 58, 183, 0.2)',
});

const Title = styled(Typography)({
  marginBottom: '2rem',
  position: 'relative',
  '&::after': {
    content: '""',
    position: 'absolute',
    bottom: '-10px',
    right: 0,
    width: '60px',
    height: '3px',
    background: 'linear-gradient(90deg, #673ab7, transparent)',
  },
});

const About = () => {
  return (
    <Container maxWidth="lg">
      <GlassContainer elevation={3}>
        <Title variant="h4" component="h1">
          عن التطبيق
        </Title>
        <Box sx={{ display: 'flex', flexDirection: 'column', gap: 3 }}>
          <Typography variant="body1">
            مرحباً بك في تطبيق تحميل فيديوهات يوتيوب! هذا التطبيق يتيح لك تحميل مقاطع الفيديو من يوتيوب بجودات مختلفة وبطريقة سهلة وسريعة.
          </Typography>
          <Typography variant="body1">
            المميزات الرئيسية للتطبيق:
          </Typography>
          <Box component="ul" sx={{ paddingRight: 2 }}>
            <Typography component="li" variant="body1">تحميل الفيديوهات بجودات مختلفة تصل إلى 4K</Typography>
            <Typography component="li" variant="body1">إمكانية تحميل المقطع الصوتي فقط</Typography>
            <Typography component="li" variant="body1">واجهة سهلة الاستخدام وتصميم عصري</Typography>
            <Typography component="li" variant="body1">سرعة في التحميل وجودة عالية</Typography>
            <Typography component="li" variant="body1">دعم للغة العربية</Typography>
          </Box>
          <Typography variant="body1">
            تم تطوير هذا التطبيق باستخدام أحدث التقنيات وأفضل الممارسات في تطوير الويب، مع التركيز على تجربة المستخدم وسهولة الاستخدام.
          </Typography>
        </Box>
      </GlassContainer>
    </Container>
  );
};

export default About;
